package com.eversec.lte.processor.decoder;

import org.apache.commons.codec.DecoderException;
import org.apache.commons.codec.binary.Hex;
import org.apache.mina.core.buffer.IoBuffer;

import com.eversec.lte.constant.SdtpConstants;
import com.eversec.lte.vo.AppMessage;

/**
 * 
 * @author bieremayi
 * 
 */
public class XdrAppBytesDecoder implements IDecoder {

	/**
	 * 
	 */
	private static final long serialVersionUID = -6191195062083378495L;
	XdrSingleBytesDecoder singleXdrDecoder = new XdrSingleBytesDecoder();
	XdrCompBytesDecoder compXdrDecoder = new XdrCompBytesDecoder();

	@SuppressWarnings("unchecked")
	@Override
	public AppMessage decode(byte[] req) {
		AppMessage appMsg = new AppMessage();
		IoBuffer buffer = IoBuffer.wrap(req);
		short xdrType = buffer.getUnsigned();
		byte[] load = new byte[req.length - 1];
		buffer.get(load);
		if (xdrType == SdtpConstants.NotifyXDRType.SINGLE) {
			appMsg.setXdrs(singleXdrDecoder.decode(load));
		} else if (xdrType == SdtpConstants.NotifyXDRType.COMP) {
			appMsg.setCxdrs(compXdrDecoder.decode(load));
		}
		return appMsg;
	}
	
	public static void main(String[] args) throws DecoderException {
		XdrAppBytesDecoder decoder = new XdrAppBytesDecoder();
		String str = "";
		decoder.decode(Hex.decodeHex(str.toCharArray()));
	}
}
